import './EventItem.css' 
import './'

function EventItem(props){
    return(
        <div className='EventItem'>
            <p>{props.title}</p> 
            <p>{props.desription}</p> 
            <p>{props.space}</p>
        </div>
    )
} 

export default EventItem
